import './css/Home.css';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import { faCircleCheck } from '@fortawesome/free-solid-svg-icons'

function Home() {
  return (
    <div className="Home">
      <body>
        <div class="container">
            <div class="box">
                <h1 class="ok"><FontAwesomeIcon icon={faCircleCheck}/></h1>
                <h1>Tranferencia Realizada com Sucesso</h1>            
            </div>
        </div>
      </body>
    </div>
  );
}

export default Home;
